    false,nt"url": null,nt"notes": "This management plan outlines how four
    Maine refuges and twelve islands and one peninsula should be managed over the next
    three to five years. Plan results are presented first as a summary of the desired
    3-5 year management actions. These actions are then addressed from two perspectives:
    1) the level of anticipated accomplishment under current funding and staff, and
    2) projected funding and staff needs to accomplish all desired management actions.
    The plan responds to specific refuge issues and potentials in conjunction with national
